.dashboard{
    width: auto !important;
    min-width: 300px;
}
.header-extra{
    // width: 25%;
    border-right: 1px solid #E9E9E9;
    text-align: center;
    padding: 0 18px;
}
.page-account-top-tit{
    font-size: 21px;
    color: #1890FF;
}
.dashboard-workplace{
    &-header{
        &-avatar{
            width: 64px;
            height: 64px;
            border-radius: 50%;
            margin-right: 16px;
        }
        &-tip{
            display: inline-block;
            vertical-align: middle;
            &-title{
                font-size: 20px;
                font-weight: bold;
                margin-bottom: 12px;
            }
            &-desc{
                color: #808695;
            }
        }
        &-extra{
            width: 100% !important;
            .ivu-col{
                p{
                    text-align: right;
                }
                p:first-child{
                    span:first-child{
                        margin-right: 4px;
                    }
                    span:last-child{
                        color: #808695;
                    }
                }
                p:last-child{
                    font-size: 22px;
                }
            }
        }
    }
}
@aaa: ~'>>>';
.conBox{
    @{aaa} .ivu-page-header-extra{
        width: auto !important;
        min-width: 457px;
    }
    @{aaa} .ivu-page-header{
        padding: 16px 0px 0 32px !important;
    }
}
